import React from "react";
import styles from "./orderPro.module.css"

function OrderPro() {
  return (
    <div className={styles.orderWrap}>
      <div style={{backgroundColor: 'tomato'}}
      className={styles.orderDiv}>장바구니</div>
      <div style={{fontSize:'40px', fontWeight:'bold'}}>&gt;</div>
      <div className={styles.orderDiv}>주문서 작성</div>
      <div style={{size:'28px', fontWeight:'bold'}}>&gt;</div>
      <div className={styles.orderDiv}>주문 완료</div>
    </div>
  );
}

export default OrderPro;
